import React from 'react'

const Part = (props) => {
    console.log(props.part)
    let result = Object.keys(props).map((key, index) => {
        <p>{key} {props[key]}</p>
    })
    return (
        <>
            <p>{result}</p>
        </>
    )
};

export default Part;
